import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100%;
`;

export const ListContainer = styled.div`
  display: flex;
`;

export const ListFoodStyle = styled.div`
  width: 70%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
`;

export const FormStyle = styled.main`
  margin-top: 8rem;
`;

export const ButtonFormStyle = styled.button`
  margin-top: 3.5rem;
  background: #2793da;
`;
